import React from 'react';
import { useQuery } from '@apollo/client';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import our shared layout component
import Layout from '../components/Layout';

// Import our routes
import Home from './home';
import MyNotes from './mynotes';
import Favorites from './favorites';
import Note from './note';
import SignUp from './signup';
import SignIn from './signin';
import NewNote from './new';
import EditNote from './edit';
import Users from './users';
import AllUser from './alluser';
import Profile from './profile';
import { IS_LOGGED_IN } from '../gql/query';

const Pages = () => {
  return (
    <Router>
      <Layout>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/mynotes" element={<PrivateRoute><MyNotes /></PrivateRoute>} />
          <Route path="/favorites" element={<PrivateRoute><Favorites /></PrivateRoute>} />
          <Route path="/note/:id" element={<Note />} />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/signin" element={<SignIn />} />
          <Route path="/users" element={<Users />} />
          <Route path="/users/:id" element={<AllUser />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/new" element={<PrivateRoute><NewNote /></PrivateRoute>} />
          <Route path="/edit/:id" element={<PrivateRoute><EditNote /></PrivateRoute>} />
        </Routes>
      </Layout>
    </Router>
  );
};

const PrivateRoute = ({ children }) => {
  const { loading, error, data } = useQuery(IS_LOGGED_IN);

  // If the data is loading, display a loading message
  if (loading) return <p>Loading...</p>;

  // If there is an error fetching the data, display an error message
  if (error) return <p>Error!</p>;

  // Check if the user is logged in
  return data.isLoggedIn ? children : <Navigate to="/signin" />;
};

export default Pages;
